const ConditionEntry = () => {
    const sliderMin = 16;
    const sliderMax = 4096;
    var sliderStart = 128;
    var sliderValue = sliderStart;
    var slider = document.getElementById('population-slider');
    slider.onInput = function () {
        sliderValue = this.value;
    }

    return (
        <div className="ConditionEntry">
            <div class="condition-form" id="temperature-form">
                <label for="temperature">Temperature (C)</label>
                <input type="text" id="temperature" name="temperature" />
            </div>
            <div class="condition-form" id="sodium-form">
                <label for="sodium">[Sodium] (mM)</label>
                <input type="text" id="sodium" name="sodium" />
            </div>
            <div class="condition-form" id="magnesium-form">
                <label for="magnesium">[Magnesium] (mM)</label>
                <input type="text" id="magnesium" name="magnesium" />
            </div>
            <div class="condition-slider">
                <label for="population-size">GA Population Size</label>
                <input type="range" min={Math.log2(sliderMin)} max={Math.log2(sliderMax)} value={Math.log2(sliderValue)} class="slider" id="population-slider" />
                <label for="population-size-value">{ sliderValue }</label>
            </div>
        </div>
    );
};

export default ConditionEntry;
